D4_02693a389ac5f55a8a0969a36b0e2731a5e85115e7bac0041902fa60e2fbb718 = "Company Information Solid reputation, passionate people and endless opportunities. That's Travelers. Our superior financial strength and consistent record of strong operating returns mean security for our customers - and opportunities for our employees. You will find Travelers to be full of energy and a workplace in which you truly can make a difference. Job Summary Under limited supervision, performs expert programming, configuring, and/or analysis. Manages the effective use of team resources to implement ongoing projects, enhancements, and/or initiatives. Participates in the design/development process. Acts as subject matter expert for assigned applications, systems, and technologies. Leads investigation and resolution efforts for critical/high impact problems, defects and incidents. Provides technical guidance to team members. This job does not lead others. Marketing Description Do you have a passion for problem-solving and learning new things? Are you inspired by the idea of being a part of a team of helpful, collaborative engineers who spend every day learning how to do their jobs better while building highly visible capabilities? The Omnichannel Program is composed of team members from across Travelers who are working to enable our customers, agents and brokers to seamlessly interact with Travelers wherever, whenever, and however they choose; and providing Travelers Employees with the ability to have a holistic view of the customer. We are looking for someone with a contagious passion for engineering solutions that solve the right problems for the right people and a keen interest in helping to build our community. We encourage new ideas and debate. We like everyone to have an engineering mindset. We rely on the depth of our unique skills combined with the ever-growing breadth of our experiences to assist in achieving our goals. We work in cross-functional teams with 2-week time boxed sprints, daily stand-ups, retrospectives, and we demo our work after each sprint to our business. Primary Job Duties & Responsibilities Responsible for system programming and analysis tasks of advanced complexity within multiple systems. Acts as subject matter expert for assigned applications, systems or technologies. Responsible for transforming business specifications and requirements into organized technical activities. Responsibilities include performing complex analysis, assessment, resolution, design, configuration and programming functions at an expert level. Leads investigation and resolution efforts for critical/ high impact defects, problems, and incidents. Collaborates with project team and other key stakeholders to identify, estimate, and prioritize project and/or enhancement activities. Builds, maintains, and utilizes partnerships across the enterprise. Provides team direction, mentorship, and feedback to technical resources. Ensures work complies with Travelers standards, processes, and protocols. Applies knowledge of current industry trends and techniques to formulate solutions within the context of assigned projects and/or enhancements. Other duties as assigned. Minimum Qualifications A bachelor's degree in Computer Science or a related field, or its equivalent in work experience, and five years of programming/development experience. Education, Work Experience & Knowledge 6 years of programming/development experience preferred. JavaScript development - both client side and NodeJS HTML and CSS Unit Testing Document databases: like Mongo Source Control: Git/Github Job Specific & Technical Skills & Competencies Technical Knowledge: Able to expertly assess, design develop, and support applications, systems and solutions to achieve business and/or technical requirements. Demonstrates technical expertise for multiple languages, applications, systems, technologies, and/or frameworks, and has the ability to influence technical direction or defect resolution. Fully understands business applications and/or technical system environments in which the system operates. Communication Skills: Ability to communicate thoughts/designs/ideas in an unambiguous manner and adjusts communication based on audience. Exhibits active and effective communication skills with team members - including active listening and effective written and verbal communication skills. Effectively contributes and communicates with the immediate team. Able to present complex technical concepts to audiences of varying size and level. Business Knowledge & Partnership: Able to develop business partnerships and influence business priorities through solution identification aligned with business objectives and goals. Able to communicate in business terms and describe IT capabilities and concepts in ways that the business can understand. Problem Solving & Decision Making: Able to proficiently diagnose root causes and solve complex problems. Able to evaluate alternative solutions and assess risk before taking action. Has the ability to reach sound decisions quickly and escalates appropriately. Demonstrates ability to optimize the use of all available resources. Team Orientation: Able to maintain and enhance partnerships across the organization to achieve objectives. Practices objectivity and openness to others' views. Able to recognize and support team priorities. Leadership: Accountable to set technical goals and priorities for self and other team members. Exhibits team leadership and collaborates with partners. Planning and Project Management: Demonstrates ability to identify critical project tasks and establish clear priorities while keeping the bigger picture in mind. Able to effectively collaborate with Project Manager and utilize sound project management practices. Able to manage time and competing priorities. Financial Awareness: Able to assess the financial impact of recommended designs/solutions. Environmental/Work Schedules/Other Requires weekend work hours. Requires overnight work hours. Requires holiday work hours (Federal and religious). Requires extended periods (1 or more weeks) of travel as needed. Requires travel up to 5% of time. Preferred Qualifications Development Practices: Pairing, Test Driven Development Cloud: Public (AWS ) and/or Private (PCF) Modern JavaScript libraries and frameworks: React, Angular Testing frameworks: JEST, NUnit Physical Requirements Operates standard office equipment. Requires extended periods of computer use. Requires extended periods of sitting. Licensing or Certificates Depends on the specific role but some examples may include: ITIL Remedy Java certification Microsoft certification.net Kanban/Agile/SAFe Equal Employment Opportunity Statement Travelers is an equal opportunity employer."
